            method: 'get',
            url: '/api/users/inactive'
        }).then(response => {
            console.log("INACTIVE USERI ", response.data);
        }).catch(error => {
            console.log(error);
        })
    // })


    return <div><h1>Inactive users ide gas</h1></div>
}

